      "rating" : 4.6,
      "reference" : "CmRSAAAArhQiau8ZpyN8Ph4bTSDk6h8eQiE0Ws33KJe5QNVdg8OQeUnbpz7dDhifbU3coOtzlqDztB4tGu01RcJ21NwR2rCE47qbNXUC4mORd9u8KzwmUGSvgwjy025p26nzRRcJEhA9ntYVySEZSZIK1ljreF1PGhSrgAsvRnkh6AVVXtNxz_g02wzUGw",
      "reviews" : [
         {
            "author_name" : "Siddhartha Gadiraju",
            "author_url" : "https://www.google.com/maps/contrib/112148801361705720282/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-q2skshZXpP4/AAAAAAAAAAI/AAAAAAAB6oc/BfleXOk3O6U/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "A good place for small plates. Wonderful culture around.  Food is served where you sit and the staff is ultra attentive. The atmosphere makes the food very fun. The fries, drinks and the rest of the food are all amazing.",
            "time" : 1522774269
         },
         {
            "author_name" : "Lindsey Scheer",
            "author_url" : "https://www.google.com/maps/contrib/100790807569920962721/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-jZ39ucxq5Tc/AAAAAAAAAAI/AAAAAAAAWVA/tWt4GJFkSxI/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 weeks ago",
            "text" : "A delicious variation on burgers & fries + we love the \"shakes\".   Probably the best fries I've had around town, they've got the perfect crispy outside & soft inside & you can't go wrong adding them to a burger :)  We like to come early (happy hour!) & since it can get a bit crowded & it get's LOUD inside.  The sidewalk seating is great in the summer, a perfect compromise.\nBTW - The menu guide is awesome if you have ANY food concerns, it helped me pick a perfect not spicy meal since I'm a complete wimp :)",
            "time" : 1521812219
         },
         {
            "author_name" : "James Huycke",
            "author_url" : "https://www.google.com/maps/contrib/118002393407215943972/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-2El0aLMN6OQ/AAAAAAAAAAI/AAAAAAAAJug/YesVNliVW7w/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "Yes, they are replacing the tables, which says a lot as they could simply be refinished. These are people who clearly care about all the details. Awesome, innovative food...the Cuban is to die for. Quick in and out. If you want a superb lunch in a short time do stop in.",
            "time" : 1520554908
         },
         {
            "author_name" : "Christopher Lui",
            "author_url" : "https://www.google.com/maps/contrib/110444351908925637361/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-fHpBerYNuI8/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCDJyT0qj7u2YFvftpWn0c6fRmo7w/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "Literally everyone I met recommended this place. And I know why now. All of the food was so flavorful. Everything had a great mix of savory and sweet. As they say, they aren't traditional Cuban, but they certainly have the feel and mix it with other great flavors. All the food I had there, I thoroughly enjoyed. It's a little expensive, but I think it's well worth the price. I will recommend it to anyone going to Ann Arbor.",
            "time" : 1517778126
         },
         {
            "author_name" : "Lauren Lintala",
            "author_url" : "https://www.google.com/maps/contrib/103224101070898455730/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-KVGgg7XEgwU/AAAAAAAAAAI/AAAAAAAACbg/ChEs35eieB8/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "Vegan loaded plantains were delicious. Coming back for those. Enjoyed a game of dominos while waiting for our food, which came out quickly. I had told the girl who took our order that it was our first time visiting. I realized after our order was placed that it has happy hour. I wish she would have told me that because I would have ordered from that menu. I like hat they had water available at the table but wish they were more environmentally conscientious about the small plastic water cups and the umbrellas they used to garnish the drinks. They looked pretty but not worth the waste to me.",
            "time" : 1518639630
         }
      ],
