      "reviews" : [
         {
            "author_name" : "A R",
            "author_url" : "https://www.google.com/maps/contrib/110449741550535951288/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-xKTbMMQCQVQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWB6xGT51JQQJ6aLBm4LPqhRrGGtJg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "Best pizza in downtown Ann Arbor.  Used to live very close by and would get takeout all the time.  The North Beach Bianca is awesome and I liked the Curry Bianca too.  Sandwiches are also tasty and a good value.  Salads were always fresh.  The one time I ate here with friends, the bartender was friendly and the pizzas came quickly.",
            "time" : 1514865858
         },
         {
            "author_name" : "Conor Daly-Seiler",
            "author_url" : "https://www.google.com/maps/contrib/114426681462657287738/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-Yi9CJoVaXwE/AAAAAAAAAAI/AAAAAAAALec/wfXmEbe9TQY/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Modern take on a classic eat! Neopapalis is always one of my favorite places to go for pizza! Thin crust, very high quality and imaginative ingredients, and great experience all around.",
            "time" : 1523221979
         },
         {
            "author_name" : "Lisa Wood",
            "author_url" : "https://www.google.com/maps/contrib/100381964105454608312/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-EMUV8QD4-h4/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBKF8VeY9Om5e3UnkLaKMgcivQ-yg/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "Amazing pizza options. Takes me back to Italy with the crust and fresh mozzarella. Friendly staff and fast service. And the best lunch deal is the pita sandwich that you can fill with all sorts of veggie options, with pick of cheese and meat too. Broccolini, arugula, roasted garlic, kalamata olives, etc and ask for beets. Good beer selection and happy hour combo too.",
            "time" : 1522277599
         },
         {
            "author_name" : "Jonathan Neubert",
            "author_url" : "https://www.google.com/maps/contrib/107019117991728465341/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-YS5o7EWz-B4/AAAAAAAAAAI/AAAAAAAABfk/oORkQTDLUSo/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 weeks ago",
            "text" : "Love this place. I recommend the traditional margherita. You cannot go wrong with this pie. Some of the best crust I've ever had! I also got a carne lover's pie which was too heavy for my taste and for the crust. With such a delicate crust, I should have stayed away from heavy toppings.",
            "time" : 1521566887
         },
         {
            "author_name" : "LeeAnn Whaley",
            "author_url" : "https://www.google.com/maps/contrib/102827131729306488792/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-u-aBK7FC4Xg/AAAAAAAAAAI/AAAAAAAAKjI/wox6bIEyJ9Q/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "The pizza was super great! High quality ingredients! My two friends and I shared two whole pizzas with no regrets. 👍",
            "time" : 1519403472
         }
