            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "January 6, 2018 was our third visit here. Once again, it was a fantastic experience! Our waiter, Tyler, was very good and our salmon and sable fish entrees were excellent. Our complimentary wedding anniversary dessert of warm chocolate cake with coconut  ice cream and cherries was very delicious and very much appreciated. We definitely will be coming back!",
