      "reviews" : [
         {
            "author_name" : "Rock Star",
            "author_url" : "https://www.google.com/maps/contrib/109428230238588630517/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-ZBpEyr1jHqg/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCjFGAgIIp9jfbsmv1KCsI9VSrdeA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "I LOVE the Gandy Dancer!\n\nBeautiful, stunning, restaurant in a restored train depot with a great view of the river. I understand the train still runs by sometimes.\n\nClassiest service in town. A first-class experience all the way.",
            "time" : 1520465494
         },
         {
            "author_name" : "Deborah Cook",
            "author_url" : "https://www.google.com/maps/contrib/106822522599264241141/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-3wEeQ4EMDiY/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWDpRy5DhurP1r4WY5VJ6hoj666cFw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "Lovely place for an anniversary dinner. Excellent staff, outstanding appetizers, but the entrees did not meet the level of excellence of the apps. The ginger rice was bland. A nice risotto would have been much better. My salmon was a bit overcooked and the coconut shrimp was good, but could have used a dipping sauce. The crab cake was the best I ever had and my husband's Chilean Sea Bass was excellent. All in all, a great dinner with a few flaws that kept it from being tremendous. Will definitely be back and will stick to grazing the appetizers,  which were five star worthy. Great staff and service and appreciated the complimentary Creme Brule, which was top notch.",
            "time" : 1517721541
         },
         {
            "author_name" : "Alfred Qualman",
            "author_url" : "https://www.google.com/maps/contrib/100851169821202135126/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-WVwg490ud-E/AAAAAAAAAAI/AAAAAAAABJk/Eqdnf51m6oc/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Eat a delicious gourmet lunch or dinner at the historical Ann Arbor Train Station on Depot Street. Trains travel the tracks just feet from window seats, people cheer or applaud them going by. On Sunday enjoy a fabulous brunch with a jazz ensemble playing. Valet parking available",
            "time" : 1523052385
         },
         {
            "author_name" : "David Graham",
            "author_url" : "https://www.google.com/maps/contrib/103862046752422467911/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-_KpYrb6FHFU/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWDPEB8SGr8u0QhSAX-_u4VkpRKMjg/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "first time there. historic Michigan central RR depot. excellent brunch and bloody Mary's that are out of this world. would return to try the dinner fare would recommend this for any occasion special or otherwise. make sure you have reservations and parking is tight there also is valet parking as well",
            "time" : 1519600628
         },
         {
            "author_name" : "Daniel Malloy",
            "author_url" : "https://www.google.com/maps/contrib/114684555294650721104/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-9ZwA8oj7RpQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBocYEtmZoJSzfygTodElmFvfEWCg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "Very Good Restaurant. Atmosphere is amazing, except for when the employees start freaking out every time a train passes. Food was very good as well. Would be 5 stars for me but even though my food was delicious with high quality ingredients, it is very expensive, and it's not too hard to find better food for a cheaper price. It's the type of place that I definitely recommend to try at least once, but for the price I probably won't go again.",
            "time" : 1519922759
         }
