            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "A lovely restaurant with great food and service. When we got married 20 years ago we had our wedding party at Gratzi. We have visited there many times since, including our anniversary last Saturday. From Andy greeting us at the door to the server and chefs - very, very Good!",
