      "reviews" : [
         {
            "author_name" : "Craig Hensley",
            "author_url" : "https://www.google.com/maps/contrib/113472735713453762110/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-FaYms_yVC_E/AAAAAAAAAAI/AAAAAAAALPc/oblG2PxOfrs/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Angelo's is one of the best food places in Ann Arbor. My wife and I visit here at least once a month on lunch from the hospital. Convenient walking distance from UMHS. Usually there is a quite a wait during the rush hour so expect to wait at least 15 min or so. If you are just going as a pair they have 6 seats at the counter that are first come first serve, and we usually can get in there and sit quickly. The food is excellent, and they serve your a really good sized portions. My wife and I can usually split a meal. Definitely try this place if you are in Ann Arbor.",
            "time" : 1522758248
         },
         {
            "author_name" : "Sheldon Buchler",
            "author_url" : "https://www.google.com/maps/contrib/115651960855001602457/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-kvyuJ02BDq8/AAAAAAAAAAI/AAAAAAAAALQ/3HWNJj3r4I8/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 weeks ago",
            "text" : "Our blueberry waffles and banana walnut pancakes were delicious. I’d like to go back soon to try their lunch stuff, it looked really good. Also they have fresh squeezed orange juice and real maple syrup!",
            "time" : 1521572702
         },
         {
            "author_name" : "Randy W.",
            "author_url" : "https://www.google.com/maps/contrib/112989316078562552948/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-glIxbfMAo1U/AAAAAAAAAAI/AAAAAAAAGxI/0Lr2y94L0XA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Iconic restaurant in Ann Arbor. Breakfast is their hallmark. Fresh baked breads and sweet breads combined with the typical breakfast standards. Angelo's does this well and consistently. It's a small establishment that fills up quickly, especially on the weekends. It's definitely worth the effort.",
            "time" : 1520593113
         },
         {
            "author_name" : "Rodney Burnett",
            "author_url" : "https://www.google.com/maps/contrib/100826379121936821225/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-QdzYiO3Kjk0/AAAAAAAAAAI/AAAAAAAAEQQ/0XmhbNn9RyM/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Mostly a sandwich joint. Reminds me of one of my favorite diners in Virginia. I had the grilled pastrami and my wife has the Reuben. Huge servings. Good service.",
            "time" : 1522958516
         },
         {
            "author_name" : "Dennis Malaney",
            "author_url" : "https://www.google.com/maps/contrib/110756110473660992102/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-SRNKyTdWHj8/AAAAAAAAAAI/AAAAAAAAACY/yun2o0rNzEw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Really really good food here. Will be back to explore the menu.\nEdit: back again and this visit was just as good as the last. Fries were cooked crispy, burger was cooked to perfection. This place certainly is on point. Best breakfast spot around.",
