      "reviews" : [
         {
            "author_name" : "Courtney Spanagel",
            "author_url" : "https://www.google.com/maps/contrib/107424668370191632581/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-pxKFX4nLED0/AAAAAAAAAAI/AAAAAAAAOgs/A1fID8UPKo4/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "a week ago",
            "text" : "Visited Cafe Zola for the first time today for Brunch and the setting has a great ambience. I got the Strawberry & Banana crepe and it was good but nothing special. It was rather dry when eating it. I also got the Salmon Omelette but they forgot to put the Salmon inside it and when mentioned there was no Salmon they didn't even know if the Salmon was cooked into the Omelette or if it goes inside it. When I saw a girl at another table who ordered the same thing the Salmon was stuffed inside her Omelette. I showed the staff and they brought out Salmon on a plate to put inside the Omelette. I was disappointed because they didn't even offer to remake a new Omelette and or make up for their mistake. The food is on the expensive side and for paying $17 for a Omelette that wasn't even made correctly is a little annoying. Probably won't visit again, and be aware they obviously don't care about their mistakes and will not offer to correct them properly.",
            "time" : 1523225604
         },
         {
            "author_name" : "Dave Barnett",
            "author_url" : "https://www.google.com/maps/contrib/114101653815019225746/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-oozYttx1O1o/AAAAAAAAAAI/AAAAAAAAjiw/N0dgRODR6Sc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "in the last week",
            "text" : "Zola has a really interesting vibe that mixes modern minimalism with a bit of retro flare. The first thing I noticed was that it was absolutely packed - that can be good and bad. The second thing I noticed were the prices... high, but not astronomical. It seemed worth a go.\n\nMy girlfriend and I ordered the two cheapest omelettes ($10 and $12 respectively) and a black coffee each. The meals were so simple that it was bordering on offensively overpriced. My omelette was literally a few eggs flaccidly folded over four slices of a sausage - no additional veggies or cheese (this was the base model), for the sum of $12. What was unknown to either of us was that our plain black coffees would be $4 each.\n\nThe waitress was lovely and the environment very pleasant. I came away with the conclusion that Zola is a fine establishment if you're looking for very simple foods and ways to rid yourself of extra money.",
            "time" : 1523827841
         },
         {
            "author_name" : "Sarah Gardner",
            "author_url" : "https://www.google.com/maps/contrib/113419220219500544386/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-3-lS8UvCrpU/AAAAAAAAAAI/AAAAAAAAANc/NZUWPE-5qV4/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "Went for brunch on a weekday. It was easy to get a spot and host and server we're friendly, although our server wasn't very attentive. Omelette and red skin potatoes were excellent.\nI tried one of the specialty cocktails, which was supposed to be mainly gin, cucumber, and lime, but it was overly sweet somehow. My friend ordered a mojito, which tasted excessively of lime and sugar. The drinks looked like they were made in pint glasses, which was probably the issue; I would rather just have a smaller, well balanced cocktail than load myself with sugared water. \nI would definitely go again for the excellent food but will not risk ordering a drink unless it's just wine or a drink on the rocks.",
            "time" : 1519474878
         },
         {
            "author_name" : "Alexandra Hall",
            "author_url" : "https://www.google.com/maps/contrib/117795537117849250416/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-E8M7MNN30Ac/AAAAAAAAAAI/AAAAAAAAAWM/Ep2dr7itTkg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "SUPER into breakfast at Zola. For lunch or dinner, I've learned to go somewhere else that suits my taste a bit better. But the breakfast warrants the five stars. Go with a friend, have the fresh squeezed orange juice and split a waffle and omelet. Or shoot for a crepe. Or the Turkish breakfast. The smoothies! The tea selection! The coffee! The toast! What are you waiting for??",
            "time" : 1521056005
         },
         {
            "author_name" : "Jesse Sade",
            "author_url" : "https://www.google.com/maps/contrib/106243516060887878852/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-yNuZ48Wbdj4/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWC-I_wTW272WWXuhnrQ2uCfvNgK3w/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "3 months ago",
            "text" : "This establishment has a very pleasant atmosphere to it. The breakfast they serve is extremely tasty. The staff is competent, well rounded, and very likeable. Overall I had a great experience when I visited and enjoyed myself greatly!",
            "time" : 1514755293
         }
