            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Really great food and service. Used their down stairs room for a team event for about 20 people and it was perfect. There is a bar downstairs so no one really had to leave the room. Did I mention that the service was amazing. The waiters were funny and perfect for what we needed. Would recommend for group events.",
