            "relative_time_description" : "3 months ago",
            "text" : "This place is a walk from campus, but oh so worth it. Delicious food, made with an eye toward healthy options. Portion sizes are big enough (in sandwiches) to take half home for dinner...if you can resist finishing it all right there! Service is also awesome and they were patient even when we didn't leave right after paying. And splitting the check was simple too. And if that weren't enough, prices are fantastic. An all-around win.",
