      "place_id" : "ChIJ18-4Nj-uPIgRCRbGKlNUZHU",
      "rating" : 4.4,
      "reference" : "CmRRAAAA9CnMv9r4WTeGKe1NXIV0MYVv5pFmv4U5x1dDJEZSvlKdiNJtaDhI96554pP2ELBDNtjLtrCGLObMa-trpvd7pEkeB-thINrfRYwdF4-JPXfypetYVqFJxp7Wm3kcDGIcEhBGdHL3GNuMurOpswGNnjBpGhTq3zmTJM3l8eaatmVMttrlBGiJYg",
      "reviews" : [
         {
            "author_name" : "Craig Johnson",
            "author_url" : "https://www.google.com/maps/contrib/110023924267436999128/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-luBWLgFtATk/AAAAAAAAAAI/AAAAAAAAFpA/1hrWCyNXrhI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "It's not just for Pizza any more! These folks have a GREAT daily buffet. At different times, I've had 3 different kinds of chicken, excellent Tex-Mex, Italian, even Roast Beef with Pizza on the buffet. What guy wouldn't want Roast Beef and Pizza for lunch? You could also make a meal out of their salad bar. I've always been greeted and treated very well by the staff. Want something off the menu? No problem. They seem to really 'step it up' to accommodate the lunch crowd and I've never been left wondering where my order was, it's quite prompt.",
            "time" : 1516727252
         },
         {
            "author_name" : "Stevee Altenbernt",
            "author_url" : "https://www.google.com/maps/contrib/104714021730982476409/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-CVURrokh4_I/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCfRhNTSpZ2EQHs0qXNwJBUHXkO2A/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "We reserved this for a rehearsal lunch and they had everything ready when we came in beautiful set up and great host. The bathrooms could use an upgrade but, they aren't dirty. They set up our table right next to the window it was beautiful.",
            "time" : 1522510575
         },
         {
            "author_name" : "Daniel B",
            "author_url" : "https://www.google.com/maps/contrib/101855135761663462347/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-0MP4ZAomWzQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBzoI0qjZfNEodIfRGyxy38WXvyxA/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Admittedly, when I showed up at 4 pm with my toddler soon, no one else was there. That being said, everyone was very friendly and helpful, our drinks and food came out quickly, the food was quite tasty, and everything was just as I hoped. We'll definitely be going back.",
            "time" : 1521230534
         },
         {
            "author_name" : "Khristen Flennoy",
            "author_url" : "https://www.google.com/maps/contrib/115170926959987240592/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-HS1xtZXmvVs/AAAAAAAAAAI/AAAAAAAABO0/YIAcqHH5bfA/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "a week ago",
            "text" : "I had very high expectations and they were quickly shot down. My work friends and I went on a Tuesday evening (about a week or so ago) and had so-so service. The waiter seemed a little preoccupied, almost like he had too many things going on at once and was struggling to keep up with everything. He absent-mindedly came to the table after we ordered and said \"I don't even know why I came over here...\" \n\nWhen the food came, it looked okay. Out of the 4 of us, 3 had pizza and 1 ordered a salad. One ordered one of the monthly pizza specials and was underwhelmed. I ordered a margherita pizza and it came without sauce. Now, I haven't eaten at Cottage Inn since I was a kid, but at any other place I've had this kind of pizza, there's at least some red sauce. The mozz was spottily placed on the crust leaving exposed pizza dough; however, the tomatoes and basil were good. The crust was also amazing, so that did help. \n\nThere was a brown seasoning on top that I couldn't identify, and tremendously interfered with the tomato-basil flavor. I asked the waiter what the seasoning was, he said it was basil. He then switched his answer to say Himalayan pink salt (??). Once I got home I realized it was garlic powder. There was already minced garlic on the pizza, so adding garlic powder overpowered the other flavors, making it quite unenjoyable. I haven't totally written off Cottage Inn. This visit may have been a fluke, so I'll be back sometime in the future to give it another try.",
            "time" : 1523122901
         },
         {
            "author_name" : "Brian Lang",
            "author_url" : "https://www.google.com/maps/contrib/109916443176322289681/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-fm63ZCykGcY/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWAXtkVwRSC_-hf07jfMcZbk9wOzQQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "I go mostly on lunch. The pizza buffet is very good and well attended to.  Salad,  several different pizzas, a meat entree, and a side are all included. The process aren't too bad and the different levels and rooms allow for nice dining experiences.",
            "time" : 1515815609
         }
