         {
            "author_name" : "Yoshita Patel",
            "author_url" : "https://www.google.com/maps/contrib/117560892694935594978/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-LXcmiNytQv8/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCemPXrVSn-JbOrNph9OoVQPGpCqg/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Chocolate Chip Pancake = Amazing. Espresso Milkshake = Amazing. Breakfast Burrito = Amazing. The line that wraps around E Liberty is worth the wait and the service is fantastic. I used to go here all the time while a student and compare all breakfast places I've been to since to Afternoon Delight. My husband and I have great memories sharing food here after exams and on the weekends. Can't wait to come back when we visit Ann Arbor for our reunions.",
            "time" : 1520817687
         },
         {
            "author_name" : "Carl Nelson",
            "author_url" : "https://www.google.com/maps/contrib/117955497423200483831/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-apRpKTQ3BGk/AAAAAAAAAAI/AAAAAAAAAEI/UqSET6ZXHfQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "3 months ago",
            "text" : "Good American diner food with a relaxed atmosphere. I really liked the biscuits with sausage gravy. Coffee was also surprisingly good and was strong. They serve both lunch and breakfast so if you're with a large group that can't decide between the two this is your spot. Another plus to this place was the booths were very comfy :)",
            "time" : 1515871709
         },
         {
            "author_name" : "Brandon Borycki",
            "author_url" : "https://www.google.com/maps/contrib/100283674961067079257/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-Tq1t_LsHYFw/AAAAAAAAAAI/AAAAAAAAA_M/VZI4WYhHbOU/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "Afternoon delight indeed! Just went there today and everything was phenomenal. Prompt service, fresh fruit in mid-winter, and the most delicious muffin I have ever had! Seriously. Best muffin ever! Perfect place to warm up for an affordable and high value meal. Go and get yourself some afternoon delight!",
            "time" : 1514830375
         },
         {
            "author_name" : "Amy K. Milligan",
            "author_url" : "https://www.google.com/maps/contrib/115277754969352625291/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-J5lDPNF-QaU/AAAAAAAAAAI/AAAAAAAAAuo/T5a7Pk-qhIM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "in the last week",
            "text" : "Prices are high (typical fot Ann Arbor) but service and experience are always great. Good place to bring kids.",
            "time" : 1523465311
         },
         {
            "author_name" : "Vance Shutes",
            "author_url" : "https://www.google.com/maps/contrib/100652760293970664019/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-PNG4_JfJQLo/AAAAAAAAAAI/AAAAAAAAMa0/scHDF-sHpTE/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "Always delicious food (especially the veggie bake and the veggie vegetable soup). Efficient deli line keeps you moving along. Well-tended and clean dining area, sometimes totally filled, but that's a good thing. One of my favorite places to eat!",
