            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "We came here for the Ann Arbor Restaurant Week and were pleasantly satisfied with our experience. We got a total of four dishes and each was emitting flavors that were complementing one another and were definitely meant to be eaten and enjoyed in unison. We got the peppers with goat cheese and a pork dish that just fell apart and dipped in a sauce tasted heavenly. Tuna was squishy, red and so fresh, WE CUT IT IN SMALLER PIECES JUST TO ENJOY IT FOR LONGER! But the atmosphere and decor is what really makes the restaurant experience so pleasant. It's open concept, exposed brick, room centered bar, yet divided arrangement breaking it into \"rooms\" feels like you're inside a large cozy apartment. THIS PLACE IS A MUST restaurant experience for anyone in the Ann Arbor area.",
