      "reviews" : [
         {
            "author_name" : "Steven S",
            "author_url" : "https://www.google.com/maps/contrib/118060191629372044696/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-O8cswZ_c7sU/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWAyORV2dAnVErUOq9vg6BMBtRpiiw/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "Been here several times. Keep coming back. The food is good and the service is as well. Nice BBQ place with other dishes to offer. The Mac & Blue is one dish I order almost every time. If you love Buffalo chicken and Mac and cheese you must order! You will not regret. Blue Tractor also offers their own micro brews. The bar area is a cool spot with with a frosty cooling strip on the bar to keep your beer chilled if you wish. Bartenders have always been friendly and attentive . I'll Be back soon!",
            "time" : 1516284749
         },
         {
            "author_name" : "Jackie Woods III",
            "author_url" : "https://www.google.com/maps/contrib/107088407750720459578/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-L2CKpmlIa3I/AAAAAAAAAAI/AAAAAAAAAIE/CT0lrAUWx8E/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "a month ago",
            "text" : "Staff was friendly. Not impressed with the pulled pork. My wife expected a sandwich not a pile of meat. The margarita was the worse we have ever had. I would give them a pass on that because they're a beer joint. \nI give them a 3 because I enjoyed my meal. I even loved the chips even though I'm a fry guy.\nOh by the way, don't go to the bathroom there, it's unheated and seemingly in a dungeon.",
            "time" : 1520521488
         },
         {
            "author_name" : "Haley",
            "author_url" : "https://www.google.com/maps/contrib/110663810031561619118/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-0ngkO6bcegE/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCM4ZPCmqUsUMo9AHf7LXtxEF1W3g/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "The food and service is fantastic. I am not a fan of BBQ usually but I will be back. \nFirst off, the only fried pickles my tastebuds have every enjoyed were from Buffalo Wild Wings but the fried pickles here put it to shame. And the sauce it comes with is fantastic which truly surprised me, it was quite addictive!\nSecond, my boyfriend got the St. Louis ribs and I got the BBQ platter. His ribs were so meaty and delicious. My beef brisket was UNBELIEVABLY amazing, it just fell apart and tasted phenomenal without even adding sauce. I’m skeptical about pulled pork as I always somehow have dry pulled pork, but theirs was beautiful and juicy. Their baked beans are also amazing. \nThird, my boyfriend got a flight and really enjoyed the brews available!\nSafe to say, we will be back, and hopefully soon!",
            "time" : 1519856048
         },
         {
            "author_name" : "grammy leah",
            "author_url" : "https://www.google.com/maps/contrib/116490763358588494961/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-nVl64T2OqvM/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWA9XO9_EILfEQ0ihsfKGBuYB6MoEA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "a week ago",
            "text" : "Too dark inside....med. service and friendly staff. I ordered reg. 1/2 slab ribs. They were thick and tasted mostly of sauce and wasn't falling off the bone.However the bed of seasoned fries were delicious and a sufficient portion size. I took home half the ribs.",
            "time" : 1523064479
         },
         {
            "author_name" : "Yas Kaz",
            "author_url" : "https://www.google.com/maps/contrib/108433481468581820916/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-NjP5x07HaB0/AAAAAAAAAAI/AAAAAAAADQ4/qhzmsFmQdcI/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "4 months ago",
            "text" : "Great location, atmosphere and service. The staff are very friendly and efficient. The food tastes good too. I'm not a big fan of the beef sliders (not enough flavors...). The beef brisket sandwich is good but my favorite so far has been the sweet potato fries!!! This is also a great place for people who can't have gluten. Pictured here is my friend's pulled pork. \nThey also have a nice selection of beer and cocktails.",
            "time" : 1512731937
         }
      ],
