            "profile_photo_url" : "https://lh3.googleusercontent.com/-LynpaY50nj4/AAAAAAAAAAI/AAAAAAAAKWk/nhwqTQHc4rg/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a week ago",
            "text" : "The pool is great. The service is great. The hotel itself is beautiful and newly renovated. We had a poolside room with a balcony that opened to the pool area with a spiral staircase down to the pool. Everything was very cool.\n\nIn the room we had two beds and the beds were so small and uncomfortable that my husband almost left in the middle of the night. This is for sure the smallest bed we have slept in together and we have traveled to Asia. So just beware that two adults barely fit in their double bed.",
