         {
            "author_name" : "Wendy Altman",
            "author_url" : "https://www.google.com/maps/contrib/115085152271757344576/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-v9S3V_zWs24/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBDlC4Z6JabuijEepJQbs0QJVaJNA/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Amazing location in the heart of Ann Arbor. The prestigious dining area is romantic, food is definitely splendid to taste, all plates seem to come prepared with enormous portions. No reason for the lights to be shut off in there anytime soon.  It's worth the visit, go to enjoy a night out with someone & cherish every special moment.",
