            "rating" : 4,
            "relative_time_description" : "a week ago",
            "text" : "Super expensive.  You can get a steak for less that is properly cooked elsewhere.  The sizzling steak served on a super hot plate is cool, but I wouldn't go unless someone else was paying the bill.",
            "time" : 1523035307
         },
         {
            "author_name" : "Nimby Dolittle",
            "author_url" : "https://www.google.com/maps/contrib/100316926774446836428/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-e_-ztLiSYT4/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCUUADJjh6aqHr5kB3RzVUIc0KEJw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "a month ago",
            "text" : "Had dinner there during restaurant week.  Overall the food and service were good.  However, they had the audacity to charge me $20 for a pour of fairly common rye whiskey (e.g. sold at Meijers).  \n\nThis same rye would be served elsewhere around town for $8 - $9 per pour.  Not very \"classy\" for a restaurant that purports itself to be \"classy.\"  This is shameless gouge job.  And, here I thought that Dave Brandon left town :-(",
            "time" : 1519702304
         },
         {
            "author_name" : "Dare Speak",
            "author_url" : "https://www.google.com/maps/contrib/112138022811966732187/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-IVqDOtn7Z1c/AAAAAAAAAAI/AAAAAAAACi0/xfQVLsDzDL0/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "4 months ago",
            "text" : "Good food and service. I head fish it was on of the best I ever had. Wine choices are over rated for the price. They need to hire someone who knows about wine. 14$ for a glass of Chardonnay that tasted just little bit better than viniger.  Little too much. But my dinner was free so I can't  complain 🤣🤣🤣",
