            "text" : "I thoroughly enjoyed my experience here.  Food, atmosphere, and service was excellent.  No complaints.  Steak flavor and quality was similar to Fogo De Chao. For the money I would choose Fogo's hands down. I absolutely cannot say anything bad about Ruth's Chris.",
