      "reviews" : [
         {
            "author_name" : "Austin Delsi",
            "author_url" : "https://www.google.com/maps/contrib/117253453628909582271/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-rcQ_jd6umgY/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCrwMi3vpxeC6CvxOP9SkrdXB8Glw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "Certainly one of Ann Arbor’s premier restaurants, Logan offers a wide selection of expertly crafted entrees with high quality service. In all of my visits, I’ve consistently received small sample dishes from the chef as a thank you for stopping in. The wait staff is very pleasant and helpful, as well. My personal recommendation is the bourbon tenderloin, though the menu has a wide variety of options. The prices are a little higher than your average Ann Arbor restaurant, but can be attributed to high quality ingredients. Logan is a fabulous restaurant for dates, business meals or parent dinners.",
            "time" : 1522333969
         },
         {
            "author_name" : "Brett Johnson",
            "author_url" : "https://www.google.com/maps/contrib/103698981667724855495/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/--jlPru9UDOg/AAAAAAAAAAI/AAAAAAAAAFE/Of-DBZnnKxs/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "in the last week",
            "text" : "Truly underrated local restaurant. Easy to overlook in the face of the ever expanding Ann Arbor dining scene, the Logan menu is filled with gems. Whereas a lot of modern restaurants try to blitz you with the latest decor trends (while serving subpar food), Logan perhaps drops the ball a bit on interior design, yes... but succeeds where it counts the most — they serve delicious cuisine. If you care about food first and foremost, add Logan to your list of places to visit.",
            "time" : 1523522996
         },
         {
            "author_name" : "Aaron Pressel",
            "author_url" : "https://www.google.com/maps/contrib/113306677267862135980/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-TNjbRGcFqyQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWB6AUfDCGA2RnM7QBoNPCeCL5uIng/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "Hidden among a large selection of high end restaurants, logan is worth seeking out. Intimate restaurant , solid menu options, and great American fusion for those who aren't looking to test out a chefs new food experiment.",
            "time" : 1522984765
         },
         {
            "author_name" : "Jessica Medina",
            "author_url" : "https://www.google.com/maps/contrib/106128385048287623932/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-QF5SU2RssCo/AAAAAAAAAAI/AAAAAAAAJTU/jtguyQBfr2o/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "4 months ago",
            "text" : "The food and drinks were delicious. The waitress was amazing as well! The only downside is that they seated us right next to the window and people were staring at us while we were eating. That felt strange and if I ever return I'll ask to be away from the window.",
            "time" : 1512221461
         },
         {
            "author_name" : "Heather Mayes",
            "author_url" : "https://www.google.com/maps/contrib/104202626244684242399/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-FvtvRS2SSqI/AAAAAAAAAAI/AAAAAAAAAKA/xwdjVAM5giI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "5 months ago",
            "text" : "Really tasty. Don't expect to go for quick meal. Go when you want to take your time; they are not in a rush and don't want you too either.",
            "time" : 1509038397
         }
