      "reviews" : [
         {
            "author_name" : "Daniel Raupagh",
            "author_url" : "https://www.google.com/maps/contrib/104028625076655134672/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-iVYz2Pp5aSM/AAAAAAAAAAI/AAAAAAAABog/TIixCOyQ7dU/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Northside is great for what it is.  There is a line out the door on weekends for a number of reasons. You wont be blown away by the ambiance but if you want good comfort food done well in a cozy place...\nGood coffee, good food and a sassy staff.\nLocals know this place and frequent it.\nReal ingredients, real food and real people.\nIt is a modest little place not upscale or pretentious.\nBest for parties of 2 or 4.\nI love the place..  will you?",
            "time" : 1520291060
         },
         {
            "author_name" : "David Lamb",
            "author_url" : "https://www.google.com/maps/contrib/104691138825337837321/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-k88QEFaZQ1A/AAAAAAAAAAI/AAAAAAAAoPc/LSR1SNPaBlk/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "I love this place! I lived in Ann Arbor for about 12 years, a good portion of that within walking distance of the Northside Grill. Now, it is a standby for when I'm in town visiting friends. Speaking of \"standing by\", while you wait outside for a table, they offer free coffee.\n\nThe food is pretty standard breakfast fare with a wide selection of omelets, eggs, hash browns...I highly recommend the Kitchen Sink (hash brown dish with lots of veggies). As a vegetarian, it is easy to find food here. As a vegan, it might be a little bit tougher, given the presence of egg in many (if not most) breakfast items.",
            "time" : 1519694958
         },
         {
            "author_name" : "Autumn M",
            "author_url" : "https://www.google.com/maps/contrib/105109015288976621101/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-5wdDHslVO7g/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBnpO-oc39ugL9TcekdnljS7c0eKQ/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "So delicious! First time here and I will definitely be back. Service was great as well as the food! Fresh squeezed orange juice was also delicious",
            "time" : 1522434140
         },
         {
            "author_name" : "Anita Kingsbury",
            "author_url" : "https://www.google.com/maps/contrib/114865642208769052361/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-3or4FfO3wu0/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCYLJ4aW0nOswevUb9Bg3KPGPT2Cg/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "The atmosphere is great, its a nice place to go for breakfast and lunch. The staff there are attentive and friendly! Its also kid friendly and has outdoor dinning in the warmer days. I have been going there when it first opened and never had a bad experience! Thumbs up northside grill!!! Keep doing what you are doing!!!",
            "time" : 1517434789
         },
         {
            "author_name" : "Wesley Fabian",
            "author_url" : "https://www.google.com/maps/contrib/114137754265816197731/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-aJD03i-nfnw/AAAAAAAAAAI/AAAAAAAARDE/yoAI9e_sHJM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
