            "text" : "My first visit was during happy hour and this is a gem of a place. Loved the east coast oyster and the French onion fondue. The best HH price in town for oysters on the half shell. Also, the drink specials were top shelf and the bartender was very friendly, attentive and offered very nice suggestions. I’ll be back!",
