         {
            "author_name" : "Sue Ellis",
            "author_url" : "https://www.google.com/maps/contrib/114993137137160273236/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-rwiVZGuVJAc/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWAiVoAFGR-fPMQn4l5uMVDzbEDxhw/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "3 weeks ago",
            "text" : "Service was quick, but they weren't busy at 10:30 am. Had omelets. Edible but better as a sandwich filler than as an omelette. Overcooked therefore dry. Good flavor though.",
            "time" : 1521472327
         },
         {
            "author_name" : "Andy Lipp",
            "author_url" : "https://www.google.com/maps/contrib/102937283793080807582/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-6DBV-tfn78g/AAAAAAAAAAI/AAAAAAAAAsA/6VVQa4V_8J8/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "Great place for breakfast and lunch.  Fast service.  Friendly wait staff that get to know you if you keep going.   Don't go to the fast food chain, go to Belll.   They have both Americans  and Korean food dishs.",
            "time" : 1522526062
         },
         {
            "author_name" : "Don Nutter",
            "author_url" : "https://www.google.com/maps/contrib/117819142242958731658/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-fyE5b5vMe5k/AAAAAAAAAAI/AAAAAAAAXYw/FQfDsQtWolA/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "We love Bell's. It's a great combination of American diner food and Korean dishes.  You can have eggs and bacon along with your kimchee!",
            "time" : 1523145149
         },
         {
            "author_name" : "Leahley Noelle",
            "author_url" : "https://www.google.com/maps/contrib/106828538452929258831/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-GSnH3HNfwQs/AAAAAAAAAAI/AAAAAAAAAP0/Kxp3o0rxDDI/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "4 months ago",
            "text" : "A lovely, lovely place! A must-recommend for anyone visiting Ann Arbor and looking for a great breakfast experience. They also have very delicious Korean food - the bibimbap is to DIE for. I also love their oatmeal and and they have great blueberry pancakes. I plan on having an omelette the next time I visit. I am sure that it will be absolutely fantastic. The ambience and decor is also gorgeous, and the waitstaff are always very kind!!",
            "time" : 1511797466
         },
         {
            "author_name" : "Bethany Osborne",
            "author_url" : "https://www.google.com/maps/contrib/108376542560401707973/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-auKsIkJPNcE/AAAAAAAAAAI/AAAAAAAADTU/Fdr6KbvFzgs/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "3 months ago",
            "text" : "Fun restaurant, American breakfast/lunch as well as Korean menu.  Casual, family friendly.  Very good service.  Generous portions.  Love the spicy tofu with brown rice.",
            "time" : 1513543011
         }
