            "text" : "Fabulous restaurant - my favorite in Ann Arbor for special occasions or quiet drinks at the bar. The service, the cocktails, the food, the deserts -  are all exceptional. Over the years, I've had almost everything on the menu and never been disappointed. I especially love the appetizers -  don't miss the seafood strudel, (seasonal) roasted caprese, and mushroom...something..... The sticky toffee pudding for desert is also to die for!",
