            "rating" : 4,
            "relative_time_description" : "3 months ago",
            "text" : "The duck nachos are to die for. But they didn't have it anymore and instead had some other duck appetizer that was just as impressive. The menu there has changed as you would expect and all four of us enjoyed our meal quite a bit. One of the best restaurants in Ann Arbor",
            "time" : 1515955473
