            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-q7mzFiQnlfs/AAAAAAAAAAI/AAAAAAAAEaw/OM3FUA2j-R4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "3 months ago",
            "text" : "Went here for New Year’s Eve and I wasn’t that impressed. The space was gorgeous, but the energy was very stuffy and stuck up. People were very rude (one person slammed a chair into my friend and another grabbed my friend’s behind). Not the kind of crowd I would like to hangout with. Then when we asked for a bouncer to come escort the harasser out, they never came. So, we had to sort it out ourselves. A cool space, but not one I would return to.",
            "time" : 1515855328
