      "reviews" : [
         {
            "author_name" : "C Mak",
            "author_url" : "https://www.google.com/maps/contrib/106843126430649555349/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-8pgN8ruVtKo/AAAAAAAAAAI/AAAAAAAANvE/Q1a6Zc-xbaU/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "2 months ago",
            "text" : "Very friendly service, however it was very slow. It was slow to get water, to get a beer, to order food, and then get our food. The food is okay. It's better than average, but it's not a place that we want to return to. They have a great tap list, however I think some of the kegs have been on tap too long and the beer was old.",
            "time" : 1517702169
         },
         {
            "author_name" : "Marshall Averill",
            "author_url" : "https://www.google.com/maps/contrib/116719245077467415839/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-Taa184WimRs/AAAAAAAAAAI/AAAAAAAAAZM/QdvLlh3bfr8/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Biga is great. Good prices, and great food. Convenient location and a nice ambience.\n\nEverything I've eaten at Biga has been tasty, but their pizza is tops. They always have a large drink selection.\n\nEven better during the warmer months when the patio area is open.",
            "time" : 1520282087
         },
         {
            "author_name" : "Angie Tobias",
            "author_url" : "https://www.google.com/maps/contrib/114714280805445678882/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-4oWzYKj00rE/AAAAAAAAAAI/AAAAAAAA3uc/kYY8SZ1GeBM/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "SUPER excited about the non-dairy options. They make their own non dairy cheese and it is SO good. Great place, upscale casual feel, super friendly staff.",
            "time" : 1522898912
         },
         {
            "author_name" : "Lori King",
            "author_url" : "https://www.google.com/maps/contrib/106333097945826699760/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-3m7dns4-FeA/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWC19fAwF4rvmx-m2qnwokxXrl6FFA/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "Great brussel sprouts and meatballs. Cool industrial atmosphere. Good wait staff. Very interesting bathrooms. Only criticism is that it took a little time to be seated at a not busy time. Staff looked over but didn't come over to seat us quickly.",
            "time" : 1517694266
         },
         {
            "author_name" : "Taylor Forrest",
            "author_url" : "https://www.google.com/maps/contrib/114275900966195707515/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-sgmUgSHoJOk/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWA4oN57DejHt9wwoLGmn_dRYEpSXA/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Bigalora has amazing pizza and wine! I love their gluten free pizza and in general they have a lot to offer if you are gluten free, which is kind of rare for a pizza place. The atmosphere is fun too!",
            "time" : 1519261338
