      "reviews" : [
         {
            "author_name" : "Josh Caps",
            "author_url" : "https://www.google.com/maps/contrib/104774271543984238946/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-y60tALA5uZc/AAAAAAAAAAI/AAAAAAAAABI/ONNJCG5dS6U/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "3 weeks ago",
            "text" : "My wife and I go here pretty consistently. The food is good, they have some appealing weekday happy hour specials, and brunch is always a win. I'm the vegan in the room, and speaking from that it is great to have a place my wife and I can both go eat a yummy meal that we are both excited about at the same restaurant. It's good for vegetarians, vegans, gluten free, and omnivores too - high quality food and service makes a real difference. Don't be turned off by the vegetarian aspect, try their yam fries and general tso cauliflower before you rule this place out.",
            "time" : 1521761026
         },
         {
            "author_name" : "Christy Jeffrey",
            "author_url" : "https://www.google.com/maps/contrib/106401602475496734308/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-BAwB8aBJ4rY/AAAAAAAAAAI/AAAAAAAAOHg/4EDxymeZDAc/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "(Vegan) As a vegan, I LOVE this place! They have an amazing selection of vegan, vegetarian and gluten free options. They have great bfast, lunch and dinner options, as well as an amazing drink, dessert and coffee menu. You can bring your meat eating friends with you here - I guarantee they will find something they can enjoy even without the meat. Great atmosphere and excellent, friendly wait staff that knows the menu well. Prices are reasonable. They also have a full bar that seats about 30 people. I highly recommend this restaurant and come here whenever I am in Ann Arbor.",
            "time" : 1523117051
         },
         {
            "author_name" : "Randy Lusebrink",
            "author_url" : "https://www.google.com/maps/contrib/101554269168580090737/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-8MgOYCRnwiY/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBxViUZ9N7HWfQ-Bfi9aVn5iXTWzQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "My wife and I along with some family met here a few weeks back.  They had been here before, and said the food was great.  To be honest, my wife and I are definitely not vegetarian much less vegan, but we decided to give it a shot.  The day we went, they had half price appetizers.  I had the cheese tots and fried cauliflower.  The cheese tots we're OK, but the cauliflower was amazing.  My wife had the Pad Thai, and loved it. . Everyone we went with loved their food.  They also accommodate people with severe gluten allergies, such as my Aunt and cousin.  If they trust this place, you should too!  The staff was nice, and the decor was nice as well.  We may have to stop by again.",
            "time" : 1517667858
         },
         {
            "author_name" : "Adam & Martie Gray",
            "author_url" : "https://www.google.com/maps/contrib/102956317424958855981/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-bVmflUax3K4/AAAAAAAAAAI/AAAAAAAAB2c/A7Djysm_5Yc/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "What can I say about this place!  Holy smokes!!  Amazing!!  Good is outstanding!  As a vegan it is so nice to go out to eat and just now worry about what I am ordering.  With all Veg/vegan options, it make the experience so much less stressful!!  We loved everything we ordered.  Prices are great.  Drinks were delicious!  Go here....like today!!",
            "time" : 1519659214
         },
         {
            "author_name" : "Natalie Schafer",
            "author_url" : "https://www.google.com/maps/contrib/103495120900913421311/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-TBN-k_7a0Ek/AAAAAAAAAAI/AAAAAAAAAC4/nEI6Ou2cJWk/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "Had a great dining experience at Seva. We had a long wait. Ordered off the fixed menu. The roasted beet salad was delicious. At first glance, there were more leaves and pecans than there were beets, but with the strawberry vinegarette dressing, the salad was absolutely refreshing. Completely unexpected, but the spinach enchilada was AMAZING. Best dish of the meal. The enchilada had some spicy sour cream sauce (i thought it was healthier than that. Tasted more like blended cashew cream), either way, the sauce was amazing as well. The dessert was mediocre. All in all, a good meal.",
            "time" : 1516472175
         }
      ],
