            "text" : "One of my favorite places to eat in Ann Arbor. Great service, delicious food! Their poutine appetizer is awesome and their desserts are delicious. Their specials are pretty creative and unique. It's a great spot especially since it's next to the movie theater.",
            "time" : 1520386184
         },
         {
            "author_name" : "Hunter Blackwood",
            "author_url" : "https://www.google.com/maps/contrib/109031458040431823258/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-B3uKcSItKa4/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCInhto8599o999WoW3-a-8gGjyGA/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "I come here quite bit to eat with my coworkers and I always enjoy myself. The staff is very friendly and accommodating. Service is quick and my drink is never left empty. The food is in general pretty good. Never messed up any of my orders and it comes quick enough after ordering. All the food is prepared with quality ingredients and to a high standard. However a few minor annoyances keep it from a 5 star quality. Simple condiments are all served in shallow side dishes which I always have to ask for more and more of then it would just be better to keep a bottle of ketchup at the bar. Their fries are usually never seasoned properly, portion sizes can either be miniscule or gargantuan and the food, while reaching for the stars sometimes falls short of premium quality it stretches for.",
            "time" : 1517016441
         },
         {
            "author_name" : "Valerie Munson",
            "author_url" : "https://www.google.com/maps/contrib/113989122516288620958/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-fh-GffkM2qU/AAAAAAAAAAI/AAAAAAAABhw/0PrZerlUTNE/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 1,
            "relative_time_description" : "in the last week",
            "text" : "Took the grands to Carlyle Grill (Jackson Road, Ann Arbor, MI) for dinner. We were told by a young female hostess the “wait for a table would be twenty or thirty minutes.” The five of us sat down to wait. \n\nAbout a minute later, a party of five (white folks) entered and requested to be seated. The hostess began to explain there was a wait to be seated, then an older white male host stepped in and said, “I can seat them.” The young hostess replied in frustration, “he always does that.” \n\nI then intervened and asked the male host why was he seating that group before us? He replied, “they have a child.” Who was actually a young person much older than a toddler. I said, ‘I have two children in my group, and we were here before them.’ We were seated immediately. \n\nSome white people need to learn how to THINK OUT LOUD!",
            "time" : 1523800154
         },
         {
            "author_name" : "Caleb Henning",
            "author_url" : "https://www.google.com/maps/contrib/102740205816304678784/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-haJbOCXdGuc/AAAAAAAAAAI/AAAAAAAAEIU/9wAucqwOkps/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "Food was pretty good. The mushroom ravioli was very creamy and perfectly umami. Service was sublime. The server, Amanda, was very personal and made sure everything came out right.",
            "time" : 1518393718
         },
         {
            "author_name" : "Aaron Pressel",
            "author_url" : "https://www.google.com/maps/contrib/113306677267862135980/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-TNjbRGcFqyQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWB6AUfDCGA2RnM7QBoNPCeCL5uIng/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "in the last week",
            "text" : "Expensive and the food doesn't match the price.  Beer selection is meh.  It isn't a bad restaurant by any means, and the service is good, it just isn't anything special.",
            "time" : 1523370377
         }
