      "reviews" : [
         {
            "author_name" : "Guy Beauregard",
            "author_url" : "https://www.google.com/maps/contrib/118171284010421614053/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-gomKawArdcA/AAAAAAAAAAI/AAAAAAAAAQQ/j1hrokUIWpI/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "This is our third visit to the Palm Palace and each time we remark how happy we are that we dine there.  The food is delicious and plentiful.  The staff gracious and helpful. The ambiance is beautiful and conducive to a lovely evening.  We highly recommend The Palm Palace.  Try the delicious earth oven baked bread.",
            "time" : 1522715965
         },
         {
            "author_name" : "Mazie Griz",
            "author_url" : "https://www.google.com/maps/contrib/113536797878515778487/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-75oeIl8LWN0/AAAAAAAAAAI/AAAAAAAAA_M/Usb6RzUeXjs/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "Amy T was super helpful and gave great recommendations.  Food was amazing. It was my first time at a Mediterranean place, and I was rather unsure. But the food was outstanding. Wish they had one in Grand Rapids! Please check it out!",
            "time" : 1518485393
         },
         {
            "author_name" : "matthew smith",
            "author_url" : "https://www.google.com/maps/contrib/103122294661777231047/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-jJ5hNR0F1Y8/AAAAAAAAAAI/AAAAAAAAEt4/hOMWzrztRkM/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "Went with my parents for their wedding anniversary and what an Absolutely great place! Service was amazing, food was amazing. Very comfortable atmosphere and genuinely appreciative people that you visited them. I will go back and back again.",
            "time" : 1522624900
         },
         {
            "author_name" : "Felicia Guedea",
            "author_url" : "https://www.google.com/maps/contrib/107548233464390317943/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-ts9LXqU2wvE/AAAAAAAAAAI/AAAAAAAAE5I/bnL71seziNo/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "They have the most amazing food. The servers are very pleasant. The owner has introduced himself and gave us some of their famous baklava. I suggest this restaurant to anyone who enjoys delicious food.",
            "time" : 1520823578
         },
         {
            "author_name" : "Madhura Gandhi",
            "author_url" : "https://www.google.com/maps/contrib/114993479770995855472/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-u6cPIuw69Fw/AAAAAAAAAAI/AAAAAAAAA6E/8XeG7IzjFFQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 3,
            "relative_time_description" : "a month ago",
            "text" : "I went to this place twice with high expectations because of the good reviews. However, it didn't turn out to be that great an experience. The food taste  is average. The tea served at the restaurant entrance is too sweet. One thing which is amazing is the garlic butter they serve complementary. It's an understaffed place, you cannot expect to have a quick bite here.",
            "time" : 1519152855
         }
