            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "My husband and I came in for lunch. The hostess was friendly and attentive as well as our server.  The portions were reasonable and the food flavorful.  I did find a bit of plastic wrap in the naan that the server offered more of, but I would of been more pleased with the scoop of mango ice cream in exchange for the rice pudding that already was included in the lunch. (Which I passed on) \nI believe this would be a good place to bring members of your party that are new to Indian cuisine as it is not as spicy as most Indian restaurants we've dined in other cities and other states, but still very flavorful. \nWe really appreciate the friendly and efficient service.",
            "time" : 1519514551
