            "profile_photo_url" : "https://lh3.googleusercontent.com/-JE5WbY8B-3w/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWA0WcyMf572izJ19p9BwlPnIIUu_A/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "2 months ago",
            "text" : "The first time I went here with my girlfriend it was quiet, the service was great, and the food was good enough especially with the low cost.  But the next time we went it was the opposite experience.  It was dead quiet but the waiter visited us once to refill our drinks after taking our $60 order and dropping off the food. \n \nWe get our cheque, I'm not unhappy with the place but I'm not happy.  I look at it, and the waiter had added a $12 gratuity to a $60 order!?  It was only myself and my girlfriend so none of it made sense.  Finally the waiter comes and has a terrible excuse (that because I am only 21 I won't tip well...).  \n\nThe manager changed the cheque to what it wouild have cost with restaurant week and offered us a 25 dollar gift card which we declined.  Why would we come back to a place that had lied about their dinner menu being over with (I realize now that the waiter wanted us to pay more and then tip well).  Overall, food was solid, manager was nice, but what the heck kind of a place is this where they lie about an ongoing deal and then try to cheat me out of my own money??",
