            "rating" : 5,
            "relative_time_description" : "5 months ago",
            "text" : "How do describe Franks would be plain. Not in the sense of plain that is normally associated with the word plain. Franks has a feeling of an old school diner that is interesting when just sitting there and looking/listening to everything that is going on around you. Now, the food. When you order your food, it's food. It's a full plate that you will look at and think \"this is a lot of food, am I going to be able to finish this?\" It's definitely a place you will go back to.",
            "time" : 1508803366
