         {
            "author_name" : "Dane Peterson",
            "author_url" : "https://www.google.com/maps/contrib/113837374278122113941/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-A0ZxZ_UZLr0/AAAAAAAAAAI/AAAAAAAAHnM/i-vaz48HS2M/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 weeks ago",
            "text" : "The meat quality is obvious. Fun toppings too. They have gluten free buns but if you are super sensitive the grill top is shared with other buns. The fryer for fries is also shared with breaded fried goodies (lots of breaded veggie options-YUM!). On the plus side staff is very friendly about the allergies. I can see why it is such a popular place. And a short walk to The Blank Slate ice cream shop 😉",
            "time" : 1522107302
         },
         {
            "author_name" : "Johnny Nichols",
            "author_url" : "https://www.google.com/maps/contrib/114889083075608828065/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-IHd8XwYRdms/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWAdnBeHSiMw_ngpoH73hTfmgIyiQA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "This place is Simply Amazing! I am a professional Burger expert and these are the best burgers on the planet that I've ever came across. The fries and vegetables are good, everything is good. The People(workers) Are Awesome!! for change you can get 50 cent pieces and $2 bills, it's a great experience and everyone should try it at least once and I'm sure you'll be back... like us :-)",
            "time" : 1515026843
         },
         {
            "author_name" : "Andy B",
            "author_url" : "https://www.google.com/maps/contrib/106033594632013581658/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-n-OUxAHjLek/AAAAAAAAAAI/AAAAAAAAJHA/u9ZQkK-5EQQ/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "Most customizable burger on earth. I think it's just as good in the new location as it was in the old location. Cafeteria style, made to order small burger patties stacked together (2 minimum if I'm not mistaken) and many many topping options, but a very strict protocol on how to order, and they aren't shy about telling you when you do it wrong. When they ask if you want anything from the fryer, do NOT tell them what you want on your burger. When they ask if you want anything grilled on your burger, they are asking about things like bacon, onions, salami, mushrooms - but NOT CHEESE! Cheese is NOT grilled, it's melted on top. Get it right or feel the wrath of their blunt correction. When they ask you if you want anything grilled on your burger, DO NOT tell them how many patties you want. They will ASK you how many patties you want when it's time! The burgers are really well liked. I think the burger itself is really only a 4 out of 5 stars, but the place as a whole is a bit more than the sum of its parts.  They also offer a variety of fried vegetables beyond just french fries including mushrooms, zucchini, onion rings and broccoli. It's an experience and the food really is quite good.",
            "time" : 1514325543
         },
         {
            "author_name" : "Russell Stambaugh",
            "author_url" : "https://www.google.com/maps/contrib/103344323982989326838/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-Nc_1U7KUNs8/AAAAAAAAAAI/AAAAAAAAADI/3x4XWkHiei4/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "I think Krazy Jim's has the best French Fried Onion Rings anywhere.  This has been an Ann Arbor institution since the middle of the last century.  Their burgers are good, much better than fast food, but not up to the standards of fine dining.  They are almost infinitely customizable.\nKrazy Jim's has a somewhat esoteric idea of customer service.  It pays to read their instructions carefully about how to order so that their process moves smoothly, or face ridicule from the staff!  You haven't really dined in Ann Arbor until you have eaten their once, and if you do, you will likely go back!",
            "time" : 1518909515
         },
         {
            "author_name" : "H F",
            "author_url" : "https://www.google.com/maps/contrib/111521223687672191960/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-r9ExhVf8RA8/AAAAAAAAAAI/AAAAAAAAA48/V8gppTGxpGQ/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 1,
            "relative_time_description" : "a week ago",
            "text" : "Greasy spoon place.  Low quality FATY meat, NO flavor taste with lousy terrible service.  Filthy floor and bathroom.  \nI have no idea what is so special about this place ???  Definitely NOT the food !\nSave your money, go somewhere else!!",
            "time" : 1523110485
         }
