      "reviews" : [
         {
            "author_name" : "Renee Li",
            "author_url" : "https://www.google.com/maps/contrib/108557105554049550450/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-zwY9C9OrhYY/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWDeqF2LuiQj_VJg73CLQpfndCOB5g/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 1,
            "relative_time_description" : "4 weeks ago",
            "text" : "I would like to give a zero for this restaurant, unfortunately there is no zeros available. The first time I went there was back to 2016 and I immediately went sick after having a dinner there. I experienced headaches, vomiting, nausea for an entire week. \n\nI always thought that probably I should give this restaurant a second chance and give it another try sometime. What if it wasn't because of the restaurant? So I came back a week ago in 2018. The servers were living in their own world and me and my friends had to try several times to get their attention. Then I was working on my lamb curry until I found a piece of metal in my food! I asked the server what the hell that is. He said: It's alright. It's breakable. Am I expected to consume metal just because it's breakable????? Then he only said one short sentence \"I apologize for this.\" with his face cold as hell. I received no further conversation or discount from this restaurant. \n\nI don't known about other people, but I won't go back ever in my life, for the sake of my own health.",
            "time" : 1521422353
         },
         {
            "author_name" : "Rock Star",
            "author_url" : "https://www.google.com/maps/contrib/109428230238588630517/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-ZBpEyr1jHqg/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCjFGAgIIp9jfbsmv1KCsI9VSrdeA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "Would love to like this place but it's a bit too stuffy for me. Food is top notch but doesn't compare to some of the dirtier Indian restaurants in town. Definitely more of a fine dining experience.\nFor the birds",
            "time" : 1520465718
         },
         {
            "author_name" : "Emma Shaver",
            "author_url" : "https://www.google.com/maps/contrib/110937896128416289417/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-gWecoUVb3Cw/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWCIYOQYPLpZ0-7NtYN5s5QTLNPGtw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "2 months ago",
            "text" : "This place exceeded my expectations! The food is awesome, great price point as well. The staff and particularly the management was wonderful. I witnessed the managememt dealing with a difficult situation (unreasonable, grumpy customers) and they handled it very professionally. I was very impressed with how hard the staff was working to accommodate all their guests and ensure everything was running efficiently. Great work! Can’t wait to eat there again.",
            "time" : 1516498528
         },
         {
            "author_name" : "Aaron Pressel",
            "author_url" : "https://www.google.com/maps/contrib/113306677267862135980/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-TNjbRGcFqyQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWB6AUfDCGA2RnM7QBoNPCeCL5uIng/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "My personal favorite of the indian restaurants in town. Good food, excellent location, spacious restaurant with good service. The food is approachable and they serve plenty of meat and vegetarian options, as well as alcohol and fresh naan.",
            "time" : 1522985529
         },
         {
