         {
            "author_name" : "Joseph Klosterman Jr.",
            "author_url" : "https://www.google.com/maps/contrib/118426360726136781533/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-1dzzmZ8gQVY/AAAAAAAAAAI/AAAAAAAAAFM/nBdVBMiRAAA/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Good sushi. Good prices. Nice atmosphere and staff. Overall no complaints. Hot tea (green) was 90¢ which was less than I expected. The presentation of the house specialty rolls was beautiful.",
            "time" : 1520808308
         },
         {
            "author_name" : "Hunter Charvat",
            "author_url" : "https://www.google.com/maps/contrib/117804869296731150093/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-94G7sFcD_xs/AAAAAAAAAAI/AAAAAAAAAEk/hfp8wfCgg3Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "It's not a bad place by any means, everything I've had there was decent to good. I just don't think it does anything to stand out. It's better sushi than you find just about anywhere on campus, but it isn't worth driving out for a student unless it's convenient. \n\nOther than being a poor location for students, I don;t have any reason not to recommend this place. Good food, fair price, decent service. The trappings are a little underwhelming, so it might not be the best place for a romantic evening, but for any other occasion it would be a good choice.",
            "time" : 1520008472
         },
         {
            "author_name" : "Tyler Cox",
            "author_url" : "https://www.google.com/maps/contrib/118244466467116265686/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh5.googleusercontent.com/-jUmb6phUh5c/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWDp_JDxPAph0f9cPA-I1MnWzYginw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "3 months ago",
            "text" : "Boy were they busy.  My wife and I thought we would be waiting for an hour yet we were pleasantly surprised to only wait 6 minutes.  The sushi is to die for!  The amazing roll is well... amazing!  The food is s little pricey but you get what you pay for and the service was great!",
            "time" : 1515203978
         },
         {
            "author_name" : "Ryan Atkins",
            "author_url" : "https://www.google.com/maps/contrib/108789692145641097124/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-cvloQzcGf_g/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWBcbmFCg36II4zbo8RV34hU429xqw/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "2 months ago",
            "text" : "The service here was friendly and speedy. The sushi was great and they DO NOT use imitation crab. Very nice place for your casual date night and grabbing lunch for the office. Location is hard to see but you can see the signage from all directions. The parking lot is small but adaquit parking is available for their restaurant.",
            "time" : 1517748757
         },
         {
