            "author_name" : "Edwardo Fuentes",
            "author_url" : "https://www.google.com/maps/contrib/109158235437117312990/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-oqXgOPPPUsE/AAAAAAAAAAI/AAAAAAAAzvk/9Jzf_125y1c/s128-c0x00000000-cc-rp-mo-ba5/photo.jpg",
            "rating" : 1,
            "relative_time_description" : "a week ago",
            "text" : "We we're excited about dining. Drove 2 hours . Menu is amazing. Upon our arrival the place was closed. Opens at 5 pm on a Saturday. Once we were finally in ; the person at the counter (who was very charming and delightful) told us any food orders won't be available  until 7pm.  Overall the online times were incorrect and the extreme wait for  dinner was a tough situation to be in for this sought after places.  We will plan more accordingly or even online. Still going to try again",
            "time" : 1523136634
         },
         {
            "author_name" : "Aaron Pressel",
            "author_url" : "https://www.google.com/maps/contrib/113306677267862135980/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-TNjbRGcFqyQ/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWB6AUfDCGA2RnM7QBoNPCeCL5uIng/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a week ago",
            "text" : "If you like fried chicken and have never been here, you are absolutely missing out. The chicken is freshly prepared for each order and takes about 30 minutes to prepare.  There's only one way to do it right and that is to call ahead and take it home.  The chicken does travel very well.  The place is very small and easy to miss, and eating in really isn't an option.",
            "time" : 1522983491
         },
         {
            "author_name" : "Chris Mitchell",
            "author_url" : "https://www.google.com/maps/contrib/115927027664884546972/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-dr5VbnJ3_k4/AAAAAAAAAAI/AAAAAAAAAAA/ACLGyWAuK6Sgway3IKhL5WSQd1jZDRainw/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "The best fried chicken I've ever had, both sauces are great but the hot is a must, the dumplings are great too. There's a wait on the chicken from 15-30 minutes but it's made to order and more than well worth the wait. The prices are great for the quality of what you're getting. Will definitely be going back",
            "time" : 1520134175
         },
         {
            "author_name" : "Alex Garcia-Wright",
            "author_url" : "https://www.google.com/maps/contrib/101753180450121847949/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-rBfkiTe7JEI/AAAAAAAAAAI/AAAAAAAASZY/FEaqqyiC-kc/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Five stars for some of the best friend chicken you can find. Order online. Book for at least one hour in advance. Show up 15 min late... Your wait will be reduced to 5-10 minutes. The chicken is indisputably amazing... Just don't bother coming here without ordering in advance!",
            "time" : 1519309408
         },
         {
            "author_name" : "Kyle",
            "author_url" : "https://www.google.com/maps/contrib/118097296862894602457/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-gwsHv-IaHL8/AAAAAAAAAAI/AAAAAAAAABY/iQpcGYoyFQM/s128-c0x00000000-cc-rp-mo/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a week ago",
            "text" : "The quality of the food is the reason to come here. The chicken wings are the best I've ever had and the sauces are amazing. It's unfortunate that their hours aren't very consistent. The food takes a while to make, but it's worth the wait. The inside of the restaurant isn't very clean, but again, it's the food that makes this place great.",
