      "reviews" : [
         {
            "author_name" : "Emily Tony",
            "author_url" : "https://www.google.com/maps/contrib/114434998249138985205/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh3.googleusercontent.com/-d-vxSIdEJ88/AAAAAAAAAAI/AAAAAAAAAao/xSVUNeXvE5s/s128-c0x00000000-cc-rp-mo-ba2/photo.jpg",
            "rating" : 4,
            "relative_time_description" : "a month ago",
            "text" : "Small-town diner feel with the best bibimbap in town at a good price. A warm, cozy restaurant perfect for those cold winter nights. I always leave with plenty of leftovers. The lack of seating means you may have to wait for a seat and it can sometimes feel cramped. If anything, I wish they gave bigger water cups so you don’t have to always stand up and walk through the tables to refill your small foam cup. Nevertheless, excellent comfort food in a location that’s a nice change of pace from all the hip, sleek, minimalist restaurants.",
            "time" : 1520389393
         },
         {
            "author_name" : "Hunter Charvat",
            "author_url" : "https://www.google.com/maps/contrib/117804869296731150093/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh6.googleusercontent.com/-94G7sFcD_xs/AAAAAAAAAAI/AAAAAAAAAEk/hfp8wfCgg3Y/s128-c0x00000000-cc-rp-mo-ba3/photo.jpg",
            "rating" : 5,
            "relative_time_description" : "a month ago",
            "text" : "Easily one of the best Korean joints I've ever been to. The menu has a wide selection of soups that will blow you away, or you can play it safe and get the bulgogi and you will not be disappointed. \n\nKang's has a great Korean diner vibe, with a bar separating the eating area from the chefs and cute wooden board menu. \n\nThe food is always delicious and it's one of the cheaper places on South U. You really can't go wrong with lunch or dinner at Kang's.",
            "time" : 1520006762
         },
         {
            "author_name" : "Kevin Zheng",
            "author_url" : "https://www.google.com/maps/contrib/111999550359901936026/reviews",
            "language" : "en",
            "profile_photo_url" : "https://lh4.googleusercontent.com/-nBQOlX3TuHo/AAAAAAAAAAI/AAAAAAAAU7I/WsZJmDtjyTY/s128-c0x00000000-cc-rp-mo-ba4/photo.jpg",
            "rating" : 2,
            "relative_time_description" : "a month ago",
            "text" : "The restaurant is small and there's no table service. The cleanliness isn't the best, access to the bathroom is through a narrow door behind the counter and down the stairs in a low ceiling basement. When I was trying to get ice, something g black kept dropping from the ice dispenser in to my cup so I ended up not getting ice. The food itself was pretty averave, I would probably only do take out from here and avoid eating in.",
            "time" : 1520231171
         },
         {
            "author_name" : "Michal S",
